import React from 'react';
import './ProductList.module.css'

const ProductList = () => {
    const list = [
        {id: 1, name: 'Item 1'},
        {id: 2, name: 'Item 2'},
        {id: 3, name: 'Item 3'},
        {id: 4, name: 'Item 4'},
    ];

    return (
        <div>
            <h2>Items List</h2>
                <ul>
                {list.map((item) => (
                    <li key = {item.id} > {item.name} </li>
                ))}
            </ul>
        </div>
    );
};

export default ProductList;
